import React from "react";
import FotoKarya from "./foto/karyamockup.png";

class Karya extends React.Component {
    render() {
        return (
            <div>
                <h2>Ini karya saya sebagai UI/UX</h2>
                <img src={FotoKarya} />
            </div>
        );
    }
}

export default Karya;
